import React, {memo} from 'react';
import styled from 'styled-components';

const BannerContentContainer = styled.div`
    width:100%;
    margin-top:60px;
    text-align: center;

    .supContentWrap{
        width:100%;
        height:480px;
        background-color: #f9f9f9;

        .supContentInner{
            max-width: 1200px;
            margin:0 auto;
            padding-top:60px;

            .supConTitle{
                font-size:30px;
                font-weight: 700;
            }

            .supContxt{
                font-size:16px;
                margin-top:10px;
                color:#959595;
            }

            .supContentItemWrap{
                display: flex;
                flex-wrap: wrap;
                margin-top:30px;

                .supContentItem{
                    border-radius: 10px;
                    border:1px solid #d9d9d9;
                    background-color: #ff0;
                    height:100px;
                    width:calc(50% - 10px);
                    margin-left:20px;
                    margin-bottom:10px;

                    &:nth-child(odd){
                        margin-left:0;
                    }
                }
            }
        }
    }
`;

const BannerContent = memo(() => {
    return (
        <BannerContentContainer>
            <div className='supContentWrap'>
                <div className='supContentInner'>
                    <h1 className='supConTitle'>신청 중인 지원 사업</h1>
                    <p className='supContxt'>현재 접수 중인 지원 사업에 대해 알아보세요.</p>
                    <div className='supContentItemWrap'>
                        <div className='supContentItem'></div>
                        <div className='supContentItem'></div>
                        <div className='supContentItem'></div>
                        <div className='supContentItem'></div>
                    </div>
                </div>
            </div>
        </BannerContentContainer>
    );
});

export default BannerContent;
